import React from 'react';

function AsideMenuComponent() {

    return (
        <>
            <aside class="menu">
                <p class="menu-label">
                    General
                </p>
                <ul class="menu-list">
                    <li><a>Dashboard</a></li>
                    <li><a>Customers</a></li>
                </ul>
                <p class="menu-label">
                    Administration
                </p>
                <ul class="menu-list">
                    <li><a>Team Settings</a></li>
                </ul>
            </aside>
        </>
    );
}

export default AsideMenuComponent;
